import Link from 'next/link';

const divStyle = {
  marginLeft: 400,
  marginRight: 400,
}

const linkStyle = {
  marginRight: 20,
  //verticalAlign: 'top' ,
};

const logoStyle = {
  marginLeft: 17,
  marginRight: 20,
  verticalAlign: 'middle' ,
  width: 100
};

const hrStyle = {
  borderTop: '2px solid #14a3bb',
};

const menuStyle = {
  float: 'right',
  //verticalAlign: 'center',
}

const Header = () => (
  <div style={divStyle}>

    <Link href="/">
      <a> <img style={logoStyle} src="../static/logo.png"/></a>
    </Link>
    <div style={menuStyle}>
      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="#about">
        <a style={linkStyle}>About</a>
      </Link>
      <Link href="#feature">
        <a style={linkStyle}>Feature</a>
      </Link>
      <Link href="/amazon">
        <a style={linkStyle}>Amazon</a>
      </Link>
    </div>
    <hr style={hrStyle}></hr>
  </div>


);

export default Header;
